    x5 = np.zeros((nocc[1], nocc[1]), dtype=np.float64)
    x5 += einsum("ai,ja->ij", l1.bb, t1.bb)
    x20 += einsum("ij->ij", x5)
    rdm1_f_oo_bb -= einsum("ij->ij", x5)
